import styled from "styled-components";
import {
  View,
  Text,
  StyleSheet,
  ImageBackground,
  Image,
  TouchableOpacity,
  ScrollView,
  Dimensions,
} from "react-native";
import { Container, Icon, Button, Content } from "native-base";

export const Cardback = styled.View`
  background-color: rgba(255, 255, 255, 0.5);
  margin: 5%;
  margin-bottom: 9%;
  border-radius: 10px;
  padding: 5%;
`;
export const Plantchip = styled.View`
  border-radius: 5px;
  padding: 5%;
`;

export const Imageback = styled.View``;
